	add("troika", "{\"term\":\"troika\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Russian\"], \"text\":\"From Russian \u0027—Ç—Ä–æÃÅ–π–∫–∞\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Russian carriage drawn by a team of three horses abreast\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1880\u0027\u0027, translating Fyodor Dostoyevsky, \u0027\u0027, Book XII, Chapter VI, [http://archive.org/stream/brotherskaramazo00dos\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"page/786/mode/2up page 787\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A great writer of the last epoch, comparing Russia to a swift \u0027\u0027troika\u0027\u0027 galloping to an unknown goal, exclaims \u0027Oh, \u0027\u0027troika\u0027\u0027, birdlike \u0027\u0027troika\u0027\u0027, who invented thee!\u0027 and adds, in proud ecstasy, that all the peoples of the world stand aside respectfully to make way for the recklessly galloping \u0027\u0027troika\u0027\u0027 to pass\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1960\u0027\u0027, Lesley Blanch, \u0027The Sabres of Paradise: Conquest and Vengeance in the Caucasus\u0027, Tauris Parke Paperbacks (2006), ISBN 1850434034, [http://books.google.com/books?id\u003dzMkv5M6MfasC\u0026amp;pg\u003dPA145\u0026amp;dq\u003dtroika+horses page 145\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"When Gogol wrote his great passage on the \u0027\u0027troika\u0027\u0027 speeding across the steppes, he likened it to Russia itself, advancing across the earth\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, \u0027The Great Game: On Secret Service in High Asia\u0027, Oxford University Press (2001), ISBN 0192802321, [http://books.google.com/books?id\u003d1_41VGoCYU8C\u0026amp;pg\u003dPA367\u0026amp;dq\u003d%22remainder+by+troika%22 page 367\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Travelling part of the way by rail and the remainder by \u0027\u0027troika\u0027\u0027, he reached Orenburg shortly before Christmas\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A party or group of three\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1981\u0027\u0027, w:Martin Cruz Martin Cruz Smith, \u0027w:Gorky Park Gorky Park\u0027, Ballantine Books (2007), ISBN 9780812977240, [http://books.google.com/books?id\u003dBk-tRhHoppYC\u0026amp;pg\u003dPA3\u0026amp;dq\u003d%22vodka+troika+that%22 page 3\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The investigator suspected the poor dead bastards were just a vodka \u0027\u0027troika\u0027\u0027 that had cheerily frozen to death\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Richard Powers, \u0027Galatea 2.2\u0027, Macmillan (2011), ISBN 9781466803688, [http://books.google.com/books?id\u003d9xCw4QPsy88C\u0026amp;pg\u003dPT92\u0026amp;dq\u003d%22The+bare+troika+of+Boolean+operators+brought+them+into+metaphorical+being%22 unnumbered page\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The bare \u0027\u0027troika\u0027\u0027 of Boolean operators brought them into metaphorical being\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Barney Hoskyns, \u0027Hotel California: The True-Life Adventures of Crosby, Stills, Nash, Young, Mitchell, Taylor, Browne, Ronstadt, Geffen, the Eagles, and Their Many Friends\u0027, John Wiley \u0026amp; Sons (2006), ISBN 9780471732730, [http://books.google.com/books?id\u003d7n38EhI2JaoC\u0026amp;pg\u003dPA265\u0026amp;dq\u003d%22troika+of%22 page 265\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"‚ÄúHe said, \u0027Let me get the best people.\u0027 And that\u0027s what he did. He got John Kalodner and Gary Gersh and Tom Zutaut, and they became stars in their own right.‚Äù Over the ensuing decade, that \u0027\u0027troika\u0027\u0027 of talent-finders would bring a host of multiplatinum artists‚Äîfrom Cher and Aerosmith to Guns N\u0027 Roses and Nirvana‚Äîto Geffen\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Tom Shone, \u0026quot;[http://www.guardian.co.uk/film/filmblog/2013/jan/11/oscar-nominations-surprise-taste Oscar nominations pull a surprise by showing some taste ‚Äì but will it last?]\u0026quot;, \u0027The Guardian\u0027, 11 January 2013\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"No longer is the best picture going to be a toss-up between that \u0027\u0027troika\u0027\u0027 of national-historical heavies: Argo, Lincoln and Zero Dark Thirty\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A committee consisting of three leaders; a triumvirate\", \"priority\":18}]}, \"synonyms\":{}}");

