	add("troop", "{\"term\":\"troop\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"French\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Proto-Germanic\", \"old norse\", \"old frisian\"], \"text\":\"Attested in English since 1545, from French \u0027troupe\u0027 (back-formation of \u0027troupeau\u0027 diminutive of \u0027troppus\u0027 \u0026quot;flock\u0026quot;) and Middle french (ca. 1400-1600) \u0027trouppe\u0027 (from Old french (842-ca. 1400) \u0027trope\u0027 (band, company, troop) , both of Proto-germanic origin from Frankish {{m|frk|*thorp||assembly, gathering}}, from Proto-germanic {{m|gem-pro|*√æurpƒÖ||village, land, estate}}, from Proto-germanic {{m|gem-pro|*treb-||dwelling, settlement}}. Akin to Old english (ca. 450-1100) \u0027√æorp\u0027 (Modern English \u0027thorp\u0027 , Old frisian \u0027√æorp\u0027 () Old norse \u0027√æorp\u0027 () More at {{l|en|thorp}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A collection of people; a company; a number; a multitude\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That which should accompany old age \u0026amp;mdash; / As honour, love, obedience, \u0027\u0027troops\u0027\u0027 of friends \u0026amp;mdash; / I must not look to have\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A small unit of cavalry or armour commanded by a captain, corresponding to a platoon or company of infantry\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A detachment of soldiers or police, especially horse artillery, armour, or state troopers\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Soldiers, military forces (usually \u0026quot;troops\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Farewell the plumed \u0027\u0027troop\u0027\u0027, and the big wars\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027troops\u0027\u0027 moved to victory with the precision of machines\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A company of stageplayers; a troupe\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A basic unit of girl or boy scouts, consisting of 6 to 10 youngsters\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A group of baboons\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A particular roll of the drum; a quick march\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Mushrooms that are in a close group but not close enough to be called a cluster\", \"priority\":15}]}, \"synonyms\":{}}");

	add("trooper", "{\"term\":\"trooper\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"From {{suffix|troop|er|lang\u003den}}, from French \u0027troupe\u0027 Sense of cavalry soldier attested 1640, mounted policeman 1858 (Australia), state policeman 1911 (US). The sense of \u0026quot;one who endures adversity\u0026quot; comes from English \u0027trouper\u0027 (member of an acting troupe) 1959, but through assimilation with the sense of \u0026quot;soldier\u0026quot; has come to be usually spelled \u0026quot;trooper\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A soldier of private rank in cavalry or armour. Abbreviated Tpr\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A cavalry horse; charger\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A soldier\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A troopship\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A state trooper\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A mounted policeman\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"One who endures adversity or hardship with an attitude of stoicism and persistence\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"He was a real \u0027\u0027trooper\u0027\u0027 about taking care of the kids for the weekend\", \"priority\":8}]}, \"synonyms\":{}}");

