	add("tropic", "{\"term\":\"tropic\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{m|la|tropicus||of or pertaining to the solstice, as a noun, one of the tropics}}, from Ancient greek (to 1453) {{m|grc|œÑœÅŒøœÄŒπŒ∫œåœÇ||of or pertaining to a turn or change; or the solstice; or a trope or figure; tropic; tropical; etc.}}, from {{m|grc|œÑœÅŒøœÄŒÆ||turn; solstice; trope}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Either of the two parallels of latitude 23¬∞27‚Ä≤north and south of the equator; the farthest points at which the sun can be directly overhead; the boundaries of the torrid zone or tropics\", \"priority\":1}]}, \"synonyms\":{}}");

