	add("troth", "{\"term\":\"troth\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027lang\u003denm\u0027 \u0027lang\u003denm\u0027 variant of \u0027lang\u003denm\u0027 \u0027lang\u003denm\u0027 from Old english (ca. 450-1100) {{m|ang|trƒìow√æ}}, {{m|ang|trƒ´ew√æ||truth, veracity; faith, fidelity; pledge, covenant}}, from Proto-germanic {{m|gem-pro|*triwwi√æ≈ç||promise, contract}}, equivalent to {{suffix|true|th|lang\u003den}}. More at {{l|en|truth}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An oath, promise, or pledge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Specifically, a promise or pledge to marry someone\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The state of being thus pledged; betrothal, engagement\", \"priority\":3}]}, \"synonyms\":{}}");

	add("trots", "{\"term\":\"trots\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Diarrhoea/diarrhea\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I\u0027ve had the \u0027\u0027trots\u0027\u0027 all morning and haven\u0027t been able to go out\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A trotting race meet; harness racing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Veronica Brodie, Mary-Anne Gale, \u0027My Side of the Bridge: The Life Story of Veronica Brodie as Told to Mary-Anne Gale\u0027, Wakefield Press, South Australia, [http://books.google.com.au/books?id\u003d8ch4NNkxNFUC\u0026amp;pg\u003dPA49\u0026amp;dq\u003d%22trots%22+racing+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dcoObUNnkM6POmgXgjoDYCQ\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22trots%22%20racing%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 49\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A lot of people used to go out to the \u0027\u0027trots\u0027\u0027 at Wayville. You‚Ä≤d see them all dressed up in their beads and bonnets and looking all flash, going off to the \u0027\u0027trots\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Mike Dillon, \u0027From The Horses Mouth: The Keith Haub Story\u0027, 2010, HarperCollins New Zealand, [http://books.google.com.au/books?id\u003dz4GSkCJu93sC\u0026amp;pg\u003dPT257\u0026amp;dq\u003d%22trots%22+racing+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnIibUMjPE6X0mAXq14HAAQ\u0026amp;redir_esc\u003dy unnumbered page\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"‚ÄòRuss drank two bottles of Coruba rum at the races then demanded to be driven to the Auckland night \u0027\u0027trots\u0027\u0027. We hadn‚Ä≤t been that keen on going to the \u0027\u0027trots\u0027\u0027, but when we dropped him there we figured we might as well stay for a couple of races\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, J. D. Carpenter, \u0027Twelve Trees\u0027, Dundurn Press, Canada, [http://books.google.com.au/books?id\u003d9Yi3YcbgEkkC\u0026amp;pg\u003dPA24\u0026amp;dq\u003d%22trots%22+racing+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dcoObUNnkM6POmgXgjoDYCQ\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dfalse page 24\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"I like both kinds of racing, thoroughbred and standardbred. Despite their lower social status, I like betting the \u0027\u0027trots\u0027\u0027 just as much as I do the flats\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Drake Hokanson, Carol Kratz, \u0027Purebred \u0026amp; Homegrown: America‚Ä≤s County Fairs\u0027, Terrace Books, US, [http://books.google.com.au/books?id\u003deE6qubyeRLYC\u0026amp;pg\u003dPA45\u0026amp;dq\u003d%22trots%22+racing+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dcoObUNnkM6POmgXgjoDYCQ\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22trots%22%20racing%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 45\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"‚ÄúIt is a fact that thousands come, pay their fee, and go straight to the amphitheater to see the \u0027\u0027trots\u0027\u0027, without whose fees premiums could not be paid to other classes\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Mike Walsh, \u00278: From Hollywood to the Garden Suburb (and Back to Hollywood): Exhibition and Distribution in Australia\u0027, Richard Maltby, Daniel Biltereyst, Philippe Meers, \u0027Explorations in New Cinema History: Approaches and Case Studies\u0027, Wiley, [http://books.google.com.au/books?id\u003d7dJgUmgunBsC\u0026amp;pg\u003dPA164\u0026amp;dq\u003d%22trots%22+racing+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnIibUMjPE6X0mAXq14HAAQ\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dfalse page 164\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The introduction of harness racing on Saturday nights at nearby Wayville in 1934 caused serious consequences for the rest of the 1930s as ‚Äòthe \u0027\u0027trots\u0027\u0027‚Äô regularly attracted crowds of 20 000. When the \u0027\u0027trots\u0027\u0027 began to offer free admission to children accompanying their parents, the state Exhibitors‚Ä≤ Association, of which Thompson was then chair, tried to agitate against this on moral grounds\", \"priority\":17}]}, \"synonyms\":{}}");

