	add("trotter", "{\"term\":\"trotter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|trot|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A horse trained for harness racing\u0026lt;sup\u0026gt;\u0026lt;/sup\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d4|passage\u003dThe Celebrity, by arts unknown, induced Mrs. Judge Short and two other ladies to call at Mohair on an afternoon when Mr. Cooke was trying a \u0027\u0027trotter\u0027\u0027 on the track. The three returned wondering and charmed with Mrs. Cooke; they were sure she had had no hand in the furnishing of that atrocious house\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The foot of a pig or sheep\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Finally Napoleon raised his \u0027\u0027trotter\u0027\u0027 for silence and announced that he had already made all the arrangements\", \"priority\":4}]}, \"synonyms\":{}}");

	add("trout", "{\"term\":\"trout\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Old english (ca. 450-1100) \u0027truht\u0027 in part from Old french (842-ca. 1400) \u0027truite\u0027 from \u0027tructa\u0027 perhaps from Ancient greek (to 1453) \u0027œÑœÅœéŒ∫œÑŒ∑œÇ\u0027 (nibbler) from \u0027œÑœÅœéŒ≥œâ\u0027 (i gnaw) from Proto-indo-european {{m|ine-pro|*tere-||to rub, to turn}}. The Internet verb sense originated on BBSes of the 1980s, probably from w:Monty Python|Monty Python\u0027s w:The Fish-Slapping Dance|The Fish-Slapping Dance (1972), though that sketch involved a halibut.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several species of fish in Salmonidae, closely related to salmon, and distinguished by spawning more than once\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d8|passage\u003dNow we plunged into a deep shade with the boughs lacing each other overhead, and crossed dainty, rustic bridges over the cold \u0027\u0027trout\u0027\u0027-streams, the boards giving back the clatter of our horses\u0027 feet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d‚ÄúPiracy‚Äù: A Romantic Chronicle of These chapter\u003d3/19/2|url\u003dhttp://openlibrary.org/works/OL1519647W|passage\u003d‚ÄúThis morning,‚Äù he said, ‚ÄúWe will fish, Turner. We will cast for \u0027\u0027trout\u0027\u0027 so that we may catch grayling.‚Äù\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An elderly woman of dubious sensibilities\", \"priority\":4}]}, \"synonyms\":{}}");

	add("trouble", "{\"term\":\"trouble\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Verb is from Middle english (1100-1500) \u0027troublen\u0027 \u0027trublen\u0027 \u0027turblen\u0027 \u0027troble\u0027 from Old french (842-ca. 1400) \u0027troubler\u0027 \u0027trobler\u0027 \u0027trubler\u0027 metethetic variants of Old french (842-ca. 1400) \u0027tourbler\u0027 \u0027torbler\u0027 \u0027turbler\u0027 from {{m|la|*turbulƒÅre}}, from Latin \u0027turbula\u0027 (disorderly group, a little crowd or people) diminutive of \u0027turba\u0027 () The noun is from Middle english (1100-1500) \u0027truble\u0027 \u0027troble\u0027 from Old french (842-ca. 1400) \u0027troble\u0027 from the verb.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A distressful or dangerous situation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A difficulty, problem, condition, or action contributing to such a situation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Lest the fiend some new \u0027\u0027trouble\u0027\u0027 raise\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Foul whisperings are abroad; unnatural deeds / Do breed unnatural \u0027\u0027troubles\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A violent occurrence or event\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003d‚ÄúI don\u0027t know how you and the ‚Äòhead,‚Äô as you call him, will get on, but I do know that if you call my duds a ‚Äòlivery‚Äô again there\u0027ll be \u0027\u0027trouble\u0027\u0027. It\u0027s bad enough to go around togged out like a life saver on a drill day, but I can stand that \u0027cause I\u0027m paid for it. What I won\u0027t stand is to have them togs called a livery. [‚Ä¶]‚Äù\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Efforts taken or expended, typically beyond the normal required\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Bryan\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"She never took the \u0027\u0027trouble\u0027\u0027 to close them\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1881\u0027\u0027, s:Robert Louis Robert Louis Stevenson, \u0027s:Virginibus Virginibus Puerisque\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Indeed, by the report of our elders, this nervous preparation for old age is only \u0027\u0027trouble\u0027\u0027 thrown away\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A malfunction\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Liability to punishment; conflict with authority\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A fault or interruption in a stratum\", \"priority\":14}]}, \"synonyms\":{}}");

