	add("trough", "{\"term\":\"trough\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle irish (900-1200)\", \"classical armenian\"], \"text\":\"From Old english (ca. 450-1100) \u0027trog\u0027 from Proto-germanic {{m|gem-pro|*trugƒÖ}}, {{m|gem-pro|*trugaz}} (compare West Frisian \u0027tr√¥ch\u0027 Dutch \u0027trog\u0027 Swedish \u0027tr√•g\u0027 , from Proto-indo-european {{m|ine-pro|*dru-k√≥}} (compare Middle irish (900-1200) \u0027drochta\u0027 (wooden basin) Classical armenian \u0027’ø’°÷Ä’£’°’¨\u0027 (ladle, spoon) enlargement of {{m|ine-pro|*d√≥ru||tree}}). More at {{l/en|tree}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A long, narrow container, open on top, for feeding or watering animals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of Hank\u0027s chores was to slop the pigs\u0027 \u0027\u0027trough\u0027\u0027 each morning and evening\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any similarly shaped container\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A rectangular container used for washing or rinsing clothes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Ernest threw his paint brushes into a kind of \u0027\u0027trough\u0027\u0027 he had fashioned from sheet metal that he kept in the sink\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A short, narrow canal designed to hold water until it drains or evaporates\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"There was a small \u0027\u0027trough\u0027\u0027 that the sump pump emptied into; it was filled with mosquito larvae\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A gutter under the eaves of a building; an eaves trough\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027troughs\u0027\u0027 were filled with leaves and needed clearing\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A channel for conveying water or other farm liquids (such as milk) from place to place by gravity; any ‚ÄòU‚Äô or ‚ÄòV‚Äô cross-sectioned irrigation channel\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A long, narrow depression between waves or ridges; the low portion of a wave cycle\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The buoy bobbed between the crests and \u0027\u0027troughs\u0027\u0027 of the waves moving across the bay\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The neurologist pointed to a troubling \u0027\u0027trough\u0027\u0027 in the pattern of his brain-waves.\u0027\u0026lt\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The valley between waves on the ocean.--\u0026gt\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A linear atmospheric depression associated with a weather front\", \"priority\":15}]}, \"synonyms\":{}}");

