	add("trover", "{\"term\":\"trover\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Nominal use of Old french (842-ca. 1400) \u0027trover\u0027 (to find)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Taking possession of personal property which has been found\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A legal action brought to recover such property by its original owner\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1749\u0027\u0027, Henry Fielding, \u0027Tom Jones\u0027, Folio Society 1973, p. 431\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The pocket-book was a late present from Mrs Western [...]. A prudent person [...] would not have offered more than a shilling, or perhaps sixpence, for it; nay, some perhaps would have given nothing, and left the fellow to his action of \u0027\u0027trover\u0027\u0027, which some learned serjeants may doubt whether he could, under these circumstances, have maintained\", \"priority\":4}]}, \"synonyms\":{}}");

